function uuidv4() {
    return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
        var r = parseFloat('0.' + Math.random().toString().replace('0.', '') + new Date().getTime()) * 16 | 0,
            v = c == 'x' ? r : (r & 0x3 | 0x8);
        return v.toString(16);
    });
}



function loadbot(language, action) {

    var agencyName = jQuery('#webchat').data('value').toString().trim();
    //for loading bot
    (async function loadBot() {

        // You can modify the style set by providing a limited set of style options
        const styleOptions = {
            botAvatarImage: 'https://inmobotimagerepository.blob.core.windows.net/inmoimages/'+agencyName+'/chatbot.jpg',
            botAvatarInitials: 'bot',
            //userAvatarImage: 'https://avatars1.githubusercontent.com/u/45868722?s=96&v=4',
            userAvatarInitials: 'Tu',//,
            bubbleMaxWidth: 320,
            bubbleMinWidth: 210,

            bubbleImageHeight: 200,
            bubbleBorderRadius: 20,
            bubbleBorderStyle: 'solid',
            bubbleNubSize: 10,
            bubbleNubOffset: "top",
            bubbleBackground: '#EEECEC',// 'rgba(0, 0, 255, .1)',
            bubbleTextColor: 'Black',
            bubbleFromUserBackground: '#223067',
            bubbleFromUserTextColor: 'White',
            bubbleFromUserBorderRadius: 20,
            bubbleFromUserBorderStyle: 'solid',
            bubbleFromUserNubSize: 4,
            bubbleFromUserNubOffset: -0,           
            typingAnimationBackgroundImage: "url('data:image/gif;base64,')",

            typingAnimationHeight: 60,
            typingAnimationWidth: 364,
            transcriptOverlayButtonBackground: '#223067',//'#223067',//'rgb(135, 206, 250)', //scroll btn css
            //transcriptOverlayButtonBackgroundOnFocus:'#5987d4',// 'rgb(0, 255, 255)',
           // transcriptOverlayButtonBackgroundOnHover:'#5987d4',// 'rgb(0, 255, 255)',
            transcriptOverlayButtonColor: 'whilte',
            fontSizeSmall: '80%',
            // monospaceFont: 'Courier New',
            primaryFont: 'leelawadee UI'
        };
        // In this demo, we are using Direct Line token from MockBot.
        // Your client code must provide either a secret or a token to talk to your bot.
        // Tokens are more secure. To learn about the differences between secrets and tokens
        // We are using a customized store to add hooks to connect event
        const store = window.WebChat.createStore({}, ({ dispatch }) => next => action => {
            if (action.type === 'DIRECT_LINE/CONNECT_FULFILLED') {
                // When we receive DIRECT_LINE/CONNECT_FULFILLED action, we will send an event activity using WEB_CHAT/SEND_EVENT
                dispatch({
                    type: 'WEB_CHAT/SEND_EVENT',
                    payload: {
                        name: 'webchat/join',
                        value: ""
                    }
                });
            }
            return next(action);
        });
        // const store = window.WebChat.createStore();
        var userId = "";
        var token = "";
        if (action === "") {
            if (language === "") {
                if (localStorage.getItem(agencyName.toString().trim()+"language") != null)
                    language = localStorage.getItem(agencyName.toString().trim()+"language").toString().trim();
                else
                    language = (window.navigator.language.toString().trim() === "es-ES" || window.navigator.language.toString().trim() === "en-US") ? window.navigator.language.toString().trim() : "es-ES";
            }
            if (localStorage.getItem(agencyName.toString().trim()+"Token") != null)
                token = localStorage.getItem(agencyName.toString().trim()+"Token");
            if (localStorage.getItem(agencyName.toString().trim()+"UserId") != null)
                userId = localStorage.getItem(agencyName.toString().trim()+"UserId");
        }
        //debugger;
        const requestData = {
            AgencyName: agencyName,//"santjustInmo",
            Token: token,
            Hosturl: window.location.hostname.toString(),
            UserId: userId,
            language:language
        }

       
        jQuery.post("https://botobi.azurewebsites.net/api/GetToken", requestData, function (data, status) {

           // debugger;
            token = data.token;
            userId = data.userId;
            localStorage.setItem(agencyName.toString().trim()+"UserId", userId);
            localStorage.setItem(agencyName.toString().trim()+"Token", token);
            localStorage.setItem(agencyName.toString().trim()+"language", language);
            window.WebChat.renderWebChat(
                {
                    directLine: window.WebChat.createDirectLine({
                        token: data.token.toString().trim()//'@((Model.Bottoken!=null)?Model.Bottoken:"")'// '2JPHKAVUjsw.emgajYV96MH_fchd-TnTQpJVPdtanU8OuEJCLyuqRsk' //'KuX-VQzuCfY.twvdyBxg5MeldxdAFBXnzJsfuKtMZqmoArFJEi9Wjk4'

                    }),
                    locale: language,
                    //locale: window.navigator.language,// 'es-ES',
                    //overrideLocalizedStrings: {
                    //    TEXT_INPUT_PLACEHOLDER: 'Escribe tu mensaje'
                    //},
                    userID: data.userId,//'@((Model.Agencybotid!=null)?Model.Agencybotid:"")',
                    userName: window.location.hostname.toString(),
                    store, styleOptions
                },
                document.getElementById('webchat')
            );

            document.querySelector('#webchat').focus();

            const parent = document.getElementsByClassName('main');
            //for changing send icon
            const child = parent[0].children[2].getElementsByTagName('svg');
            const svg = document.createElementNS("http://www.w3.org/2000/svg", "svg");
            const img = document.createElement("img");
            img.src = 'https://www.chatbotinmobiliario.es/botobiresurcefiles/img/icons/send.png';
            svg.setAttribute('height', '20');
            svg.setAttribute('width', '20');
            svg.appendChild(img);
            child[0].replaceWith(img);

            //for changing attach icon
            const childattach = parent[0].children[0].getElementsByTagName('svg');
            const svgsttach = document.createElementNS("http://www.w3.org/2000/svg", "svg");
            const imgattach = document.createElement("img");
            imgattach.src = 'https://www.chatbotinmobiliario.es/botobiresurcefiles/img/icons/file.png';
            svgsttach.setAttribute('height', '20');
            svgsttach.setAttribute('width', '20');
            svgsttach.appendChild(imgattach);
            childattach[0].replaceWith(imgattach);

        });

        // alert(token);

        //document.querySelector('#webchat').addEventListener('mousedown', () => {
        //    store.dispatch({
        //        type: 'WEB_CHAT/SEND_MESSAGE',
        //        payload: { text: '-' }
        //    });
        //});

        

    })().catch(err => console.error(err));
}